<ul>
<li>4KB</li>
<li>过量的 Cookie 会带来巨大的性能浪费</li>
<li>Cookie 是紧跟域名的</li>
<li>Cookie 是明文传递的，容易泄露用户信息，安全性不高。</li>
</ul>
